Rikki-Tikki-Tavi is a short story in The Jungle Book (1894) by Rudyard Kipling about the adventures of a valiant young mongoose.

The story is a favorite of Kipling fans and is notable for its frightening and serious tone. Some epic features (heightened prosaic style, songs to the hero) add to the standard typology of hero defeating villain. It has often been anthologized and has also been published more than once as a short book in its own right. The story was also adapted into an animated TV special by American animator Chuck Jones in 1975. That same year the story was adapted as a Russian animated short film.


